import React from 'react';
import '../styles/Dashboard.css';

const Dashboard = ({ tasks, onAddTask }) => (
  <div className="dashboard">
    <h2>Dashboard</h2>
    <button onClick={onAddTask}>Add Task</button>
    <ul>
      {tasks.map(task => (
        <li key={task.id}>{task.title}</li>
      ))}
    </ul>
  </div>
);

export default Dashboard;
